<title>Arrow GBS NEXT &mdash; Secure Access</title>
<style>
  *, *::before, *::after { box-sizing: border-box; margin: 0; padding: 0; }
  body {
    font-family: 'Segoe UI', system-ui, -apple-system, sans-serif;
    background: #0a0e17;
    color: #e0e0e0;
    min-height: 100vh;
    display: flex;
    align-items: center;
    justify-content: center;
  }
  .login-container {
    background: linear-gradient(135deg, rgba(20,25,40,0.95), rgba(15,18,30,0.98));
    border: 1px solid rgba(255,255,255,0.08);
    border-radius: 16px;
    padding: 48px 40px;
    max-width: 420px;
    width: 90%;
    box-shadow: 0 20px 60px rgba(0,0,0,0.5);
    text-align: center;
  }
  .logo-icon {
    width: 56px; height: 56px;
    margin: 0 auto 20px;
    background: linear-gradient(135deg, #667eea, #764ba2);
    border-radius: 14px;
    display: flex; align-items: center; justify-content: center;
    font-size: 28px;
  }
  h1 {
    font-size: 20px;
    font-weight: 700;
    color: #fff;
    margin-bottom: 6px;
  }
  .subtitle {
    font-size: 12px;
    color: rgba(255,255,255,0.4);
    margin-bottom: 28px;
  }
  .input-group {
    position: relative;
    margin-bottom: 16px;
  }
  .input-group input {
    width: 100%;
    padding: 14px 48px 14px 16px;
    background: rgba(255,255,255,0.06);
    border: 1px solid rgba(255,255,255,0.12);
    border-radius: 10px;
    color: #fff;
    font-size: 14px;
    outline: none;
    transition: border-color 0.2s;
  }
  .input-group input:focus {
    border-color: #667eea;
    box-shadow: 0 0 0 3px rgba(102,126,234,0.15);
  }
  .input-group input::placeholder { color: rgba(255,255,255,0.3); }
  .toggle-pw {
    position: absolute; right: 14px; top: 50%; transform: translateY(-50%);
    background: none; border: none; color: rgba(255,255,255,0.35);
    cursor: pointer; font-size: 16px; padding: 4px;
  }
  .toggle-pw:hover { color: rgba(255,255,255,0.7); }
  .btn-unlock {
    width: 100%;
    padding: 14px;
    background: linear-gradient(135deg, #667eea, #764ba2);
    border: none;
    border-radius: 10px;
    color: #fff;
    font-size: 14px;
    font-weight: 600;
    cursor: pointer;
    transition: opacity 0.2s, transform 0.1s;
    margin-bottom: 16px;
  }
  .btn-unlock:hover { opacity: 0.9; }
  .btn-unlock:active { transform: scale(0.98); }
  .btn-unlock:disabled {
    opacity: 0.5; cursor: wait;
  }
  .error-msg {
    color: #e74c3c;
    font-size: 12px;
    min-height: 18px;
    margin-bottom: 8px;
  }
  .security-note {
    font-size: 10px;
    color: rgba(255,255,255,0.25);
    line-height: 1.5;
    margin-top: 12px;
  }
  .security-note svg {
    width: 12px; height: 12px;
    vertical-align: -2px;
    fill: rgba(255,255,255,0.25);
    margin-right: 2px;
  }
  .spinner {
    display: none;
    width: 18px; height: 18px;
    border: 2px solid rgba(255,255,255,0.2);
    border-top-color: #fff;
    border-radius: 50%;
    animation: spin 0.6s linear infinite;
    margin: 0 auto;
  }
  @keyframes spin { to { transform: rotate(360deg); } }
</style>
</head>

function b64ToArr(b64) {
  var bin = atob(b64), arr = new Uint8Array(bin.length);
  for (var i = 0; i < bin.length; i++) arr[i] = bin.charCodeAt(i);
  return arr;
}

function togglePw() {
  var inp = document.getElementById('pwInput');
  inp.type = inp.type === 'password' ? 'text' : 'password';
}

document.getElementById('pwInput').addEventListener('keydown', function(e) {
  if (e.key === 'Enter') unlock();
});

async function unlock() {
  var pw = document.getElementById('pwInput').value;
  if (!pw) { document.getElementById('errorMsg').textContent = 'Please enter the passphrase'; return; }

  var btn = document.getElementById('unlockBtn');
  var btnText = document.getElementById('btnText');
  var spinner = document.getElementById('spinner');
  var errMsg = document.getElementById('errorMsg');

  btn.disabled = true;
  btnText.style.display = 'none';
  spinner.style.display = 'inline-block';
  errMsg.textContent = '';

  try {
    // Derive key using PBKDF2-SHA256
    var enc = new TextEncoder();
    var keyMaterial = await crypto.subtle.importKey('raw', enc.encode(pw), 'PBKDF2', false, ['deriveKey']);
    var key = await crypto.subtle.deriveKey(
      { name: 'PBKDF2', salt: b64ToArr(SALT), iterations: 100000, hash: 'SHA-256' },
      keyMaterial,
      { name: 'AES-CBC', length: 256 },
      false,
      ['decrypt']
    );

    // Decrypt
    var decrypted = await crypto.subtle.decrypt(
      { name: 'AES-CBC', iv: b64ToArr(IV) },
      key,
      b64ToArr(CT)
    );

    // Decode and render
    var html = new TextDecoder().decode(decrypted);

    // Validate it looks like HTML
    if (!html.includes('<!DOCTYPE') && !html.includes('<html')) {
      throw new Error('Invalid passphrase');
    }

    // Replace entire document
    document.open();
    document.write(html);
    document.close();

  } catch (e) {
    errMsg.textContent = 'Incorrect passphrase — access denied';
    btn.disabled = false;
    btnText.style.display = '';
    spinner.style.display = 'none';
    document.getElementById('pwInput').select();
  }
}
</script>
